import React from 'react'
import ReactDOM from 'react-dom'

// Tehtävä 2.1 - A separate phonebook component

const Header = (props) => {
  return (
    <h1>
      <p>{props.title}</p>
    </h1>
  )
}

const Entry = (props) => {  

  return(
    <div>
      <tr>
        <td>Name: {props.name}</td><td>Number: {props.phone}</td>
      </tr>
    </div>
  )
}

const Contents = (props) => {

  return (
    <div>
      <table>
        {props.contacts.map}(entry => <Entry name={props.contacts.name} phone = {props.contacts.phonenumber} />)
      {/* <Entry name = {props.contacts[0].name} phone = {props.contacts[0].phonenumber} />
      <Entry name = {props.contacts[1].name} phone = {props.contacts[1].phonenumber} />
      <Entry name = {props.contacts[2].name} phone = {props.contacts[2].phonenumber} /> */}
      </table>
    </div>
  )
}

// Teht 2.1 luodaan tämmöinen elementti, joka ottaa sisäänsä Appissa asetetut parametrit
const Phonebook = ({phonebook}) => {

  return (
    <div>
      <Header title = 'Superadvanced phonebook app'></Header>
      <Contents contacts = {phonebook.contacts}></Contents>


    </div>


  )

}

const App = () => {
  const phonebook = {
    name: 'Superadvanced phonebook app',
    contacts: [
      {
        name: 'John Doe',
        phonenumber: '358401234567',
        id: 1
      },
      {
        name: 'Jane Doe',
        phonenumber: '44551234567',
        id: 2
      },
      {
        name: 'Foo bar',
        phonenumber: '000',
        id: 3
      }
    ]
  }

  return (
    <div>
      <Phonebook phonebook={phonebook} />
    </div>
  )
}


ReactDOM.render(
  <App />,
  document.getElementById('root')
)
